function exportToExcel(e=document,t){const o=e.querySelectorAll("table");// get table elements as sheets
let l=XLSX.utils.book_new(),n=0;for(const e of o){let t=XLSX.utils.table_to_sheet(e);XLSX.utils.book_append_sheet(l,t,o[n].id||"Sheet "+n++)}var r=XLSX.write(l,{bookType:"xlsx",type:"binary"}),s=new Blob([s2ab(r)],{type:"application/octet-stream"});// Convert excel to binary
// Create a Blob object for the binary data
saveAs(s,(".xlsx"==t.slice(-5)?t:t+".xlsx")||"myFile.xlsx")}
/* Utility function to convert a string to an ArrayBuffer */function s2ab(e){for(var t=new ArrayBuffer(e.length),o=new Uint8Array(t),l=0;l<e.length;l++)o[l]=255&e.charCodeAt(l);return t}